import React from 'react';
import Link from 'next/link';

export default function Profile() {
  return (
    <div>
      <h1>Welcome to your profile</h1>
      <p>Wanna edit something?</p>
      <Link href="/">
        <a title="Go home">Homepage</a>
      </Link>
    </div>
  );
}
